// Channels

import React from 'react';
import PropTypes from 'prop-types';
import './profile.scss';

const Profile = props => {
    return (
        <section className="profile">
            <div className="container">
                <p className='col-md-12'  >Thông tin tài khoản </p>
                <div className="row" style={{marginTop:'30px'}}>
                    <label className="col-md-2 mt-1" >Họ tên </label> <input placeholder="Nhập họ tên" value="Văn Mến"  className="form-control col-md-8" type="text" />
                </div>
                <div className="row" style={{marginTop:'10px'}}>
                    <label className="col-md-2 mt-1" >Email</label> <input placeholder="Nhập email" value="pvmen1310@gmail.com" required className="form-control col-md-8" type="text" />
                </div>
                <div className="row" style={{marginTop:'10px'}} >
                    <button className="col-md-8" style={{backgroundColor:"#ff9340",marginLeft:'75px'}} >Tạo tài khoản</button>
                </div>
            </div>
        </section>
    );
};

export default Profile;
